import React, {useState} from 'react';
import './App.css';

const App = () => {
  const [todos, setTodos] = useState([
    {
      text:"Learn ReactHooks",
      isCompleted: false
    },
    {
      text:"Go get boba",
      isCompleted: false
    },
    {
      text:"play basketball",
      isCompleted: false
    }
  ])

  return (
    <div className="app">
      <div className="todo-list">
        Hi people
        {todos.map((todo, index) => {
          <Todo />
        })}
      </div>
    </div>
  )
}


const Todo = () => {
  return(
    <div className="todo">
      "hi"
    </div>
  )
}


export default App;
